  24379 => 
  array (
    'game_id' => '24379',
    'fk_account_id' => '6789',
    'fk_coauthor_account_id' => '0',
    'title' => 'Space Cropper',
    'short_description' => 'Space Cropper is a Qix / Volfied like retro game with enhanced gameplay and graphics.
17 monsters with special abilities and 2 special bosses to fight against over 20 different levels.
Get back the territories that the aliens have taken from us!',
    'full_description' => '<p><strong>(03/05/2014) Back on sales, if anyone interested, please contact me.</strong></p>
<p><strong>Space Cropper </strong>(previously named SpaceBugx) is a Qix/Volfied like retro game with <strong>enhanced gameplay, retro graphics and special effects</strong>.</p>
<p>Your mission: get back the territories that the aliens have taken from us. This will require accuracy and speed.</p>
<p>Over <strong>17 monsters&nbsp;</strong><strong>with special abilities</strong> and <strong>2 special bosses</strong> to fight against.</p>
<p><strong>20 levels</strong> with 3 levels of tutorial.<br />The 10th and 20th are boss levels.</p>
<p><strong>Various special items</strong> popping up during the game:</p>
<ul>
<li>slow: slows down enemies</li>
<li>points: gives points</li>
<li>invincible: gives invincibility for a couple of seconds</li>
<li>shield: increases your shield energy</li>
<li>life: gives you one more life</li>
</ul>
<p>The game is <strong>finished. </strong>I\'m still open to any suggestion!</p>
<h5><strong>Controls:</strong></h5>
<p><strong></strong><strong>arrow keys</strong> -&nbsp;to control space ship &amp;&nbsp;to navigate menu&nbsp;<strong>(can be customized)</strong><br /><strong>space bar</strong>&nbsp;-&nbsp;action key (to cut areas in game) &amp; to select menu item&nbsp;<strong>(can be customized)</strong></p>
<h5>Screenshots:</h5>
<p><strong>Home:</strong></p>
<p><strong></strong><img src="http://blog.open-design.be/wp-content/uploads/2012/06/spacecropper_screenshot01.jpg" alt="" /></p>
<p><strong>Options (set keys):</strong></p>
